import React from 'react'
import './forms.css';

const Login = () => {
    return (
        <div className="wrapper">
            {/* Header Start */}
            <header className='header-container'>
                <Header />
            </header>
            {/* Header End */}

            {/* Main Start */}
            <main className='main-container'>
                <Filter />
            </main>
            {/* Main End */}

            {/* Footer Start */}
            <footer className='footer-container'>
                <Footer />
            </footer>
            {/* Footer End */}

        </div>
    )
}

export default Login
